    PatientrecordComponent.prototype.dosubmit = function (formval) {
        if (this.dataForm.valid) {
            var link = this.serverurl + 'editpatient';
            var data = {
                id: this.id,
                firstname: formval.firstname,
                lastname: formval.lastname,
                email: formval.email,
                phone: formval.phone,
                //  address: formval.address,
                city: formval.city,
                state: formval.state,
            };
            console.log(data);
            this._http.post(link, data)
                .subscribe(function (data) {
                //  this.pateintquestioniremodal = true;
                /* if (this.cookiedetails.type == 'superadmin') {
                  this.router.navigate(['/patient-list' , 'admin']);
                }
                else {
                this.router.navigate(['/patient-list']);
                }*/
            }, function (error) {
                console.log('Oooops!');
            });
        }
    };
