    PatientrecordComponent.prototype.gethelpdeskmailid = function () {
        var _this = this;
        var link = this.serverurl + 'gethelpdeskmailidbypatientid';
        var data = {
            patientid: this.id
        };
        //  console.log(data);
        this._http.post(link, data)
            .subscribe(function (data) {
            var result = data.json();
            if (result.status == 'success') {
                //  console.log('=============');
                //  console.log(result.id);
                if (result.id.Helpdeskdetail.length > 0) {
                    _this.helpdeskmailid = result.id.Helpdeskdetail[0].email;
                }
                if (result.id.Addedbyrepdetail != null) {
                    _this.addedbyrepdetailname = result.id.Addedbyrepdetail[0].firstname + ' ' + result.id.Addedbyrepdetail[0].lastname;
                }
                _this.patientuniqueid = result.id.uniqueid;
            }
        }, function (error) {
            console.log('Oooops!');
        });
    };
