    PatientrecordComponent.prototype.updatevalue = function (val) {
        var _this = this;
        console.log('updatevalue');
        if (this.divshowself == 0) {
            //  console.log( $('input[name="' + val + '"]').is(':checked') );
            setTimeout(function () {
                //  $( '#newpopup_conbox_wrapper_1' ).find('input[type="checkbox"]').each(function() {
                // if ($( '#newpopup_conbox_wrapper_1' ).find('input[type="checkbox"]')) {
                //  if ($(this). prop('checked') == true) {
                if ($('input[name="' + val + '"]').is(':checked') == true) {
                    console.log(val);
                    if (val == 'Breast_0' || val == 'Breast1_0') {
                        _this.breastcancercount++;
                    }
                    if (val == 'Ovarian1_0') {
                        _this.ovariantcancercount++;
                    }
                    if (val == 'Digestive Organs_0' || val == 'Digestive Organs1_0') {
                        _this.digestivecancercount++;
                    }
                    console.log();
                }
                else {
                    if (val == 'Breast_0' || val == 'Breast1_0') {
                        _this.breastcancercount--;
                    }
                    if (val == 'Ovarian1_0') {
                        _this.ovariantcancercount--;
                    }
                    if (val == 'Digestive Organs_0' || val == 'Digestive Organs1_0') {
                        _this.digestivecancercount--;
                    }
                }
                console.log(' this.breastcancercount -----' + _this.breastcancercount);
                console.log(' this.ovariantcancercount -----' + _this.ovariantcancercount);
                console.log(' this.digestivecancercount -----' + _this.digestivecancercount);
            }, 500);
        }
    };
